Компания «Сайнекс групп» специализируется на комплексном обслуживании Российских компаний, связанном с поиском деловых партнеров в Китайской Народной Республики и сопровождением внешнеэкономических сделок.
Мы стремимся предложить качественные и относительно недорогие товары, поэтому внимательно подходим к выбору поставщиков. Основными производителями являются заводы Южного Китая - что служит гарантией европейского качества при весьма доступной и разумной цене. 

По Вашему желанию мы произведем:

• Поиск производителей и поставщиков интересующих Вас товаров и услуг (включая оптовые поставки из Китая), а также партнеров для производства и бизнеса в КНР или в РФ; 
• Проверку надежности партнеров;
• Помощь в ведении переговоров, включая услуги профессиональных переводчиков;
• Поставку образцов продукции при выборе производителя/поставщика;
• Анализ, в т.ч. определение рисков, проверка и подготовка ВЭД (внешнеэкономической деятельности) контрактов;
• Реализацию ВЭД сделки (контракта) клиента в качестве получателя (импортера) товара в РФ; 
• Контроль отгрузки товара; 
• Проверку соответствия товара экспортным транспортным и таможенным документам;
• Передачу товара клиенту на территории РФ по договору с полным пакетом необходимых сопроводительных документов;
• Консалтинг на всех этапах ведения ВЭД с Китаем; 
• Обязательную  сертификацию ввозимого товара;
• Регистрация бренда в Китае.

Преимущества сотрудничества с нами:

- Постоянный представитель в Китае (г. Гуанчжоу);
- Наличие склада в КНР;
- Прямые поставки товара непосредственно от производителей;
- Знание особенностей китайского рынка;
- Мониторинг выполнения заказа;
- Таможенное оформление и декларирование на территории РФ;
- Сопровождение груза до покупателя транспортными компаниями РФ.

Защищая интересы наших клиентов, мы сотрудничаем только с надежными и проверенными компаниями и фирмами Китая.

По всем вопросам обращаться по телефону:

SKYPE: sinexgroup
